window.bookSummaryJSON = "<p><b>I wanted answers.</b></p> <p>To know who I was and where I came from. How had I ended up in those woods all alone? Why didn't I have elemental magic like everyone else? What made me so different?</p> <p>I thought I wanted it more than anything, but I was wrong. Everything is spinning out of control as my past and present collide, leaving me feeling like a stranger to myself.</p> <p>I always wanted to find my home, a place where I belong, but what if home isn't a place? What if it's a feeling? Home is with the guys, and while they might drive me up the wall with their alpha tendencies, I wouldn't change a thing.</p> <p>I wanted answers, and I've got them, or at least most of them.</p> <p>Now, if I could just figure out what's wrong with me, we might just have a chance of surviving the man who seems intent on killing me.</p> <p>Shaped by Discovery <i>is book two in the Beasts of Extinction series and ends on a cliffhanger. This is a full-length shifter romance that has some darker elements and multiple love interests. For mature listeners.</i></p>"; 
